var $bm_rt;
var controllerValue = effect('Ellipse Path 1 Size')(1);
var x = $bm_mul(value[0], $bm_mul(controllerValue, 0.01));
var y = $bm_mul(value[1], $bm_mul(controllerValue, 0.01));
if (value.length < 2) {
    var z = $bm_mul(value[2], $bm_mul(controllerValue, 0.01));
    $bm_rt = [
        x,
        y,
        z
    ];
} else {
    $bm_rt = [
        x,
        y
    ];
}

